        public static void DynamicParse()
        {
            var fields = typeof(WiresharkArrayC).GetFields(System.Reflection.BindingFlags.Static | System.Reflection.BindingFlags.Public);

            var packets = new List<PacketInfo>();

            foreach (var field in fields)
            {
                var match = Regex.Match(field.Name, @"^peer(?<src>\d+)_(?<pid>\d+)$");
                if (!match.Success) continue;
                var buffer = field.GetValue(null) as byte[];
                if (buffer == null) continue;

                var packet = new PacketInfo
                {
                    Data = buffer,
                    PID = int.Parse(match.Groups["pid"].Value),
                    Source = byte.Parse(match.Groups["src"].Value),
                };

                packets.Add(packet);
            }

            var gamePackets = PacketInspectorService.ParseRawPackets(packets.ToArray(), out bool fullReaded);

            var sb = new StringBuilder();

            foreach (var packet in gamePackets)
            {
                // if (packet.PacketInfo.Source != 1) continue;

                sb.AppendLine($"// {packet.PacketInfo.Name} ({(packet.PacketInfo.Source == 0 ? "Client" : "Server")})");
                sb.AppendLine("SendPacket(");
                sb.AppendLine($"{packet.PacketInfo.Id},");
                sb.AppendLine($"{packet.PacketInfo.Length},");
                sb.AppendLine($"new byte[] {{ {string.Join(",", packet.Data.Select(x => x.ToString()).ToArray()) } }}");
                sb.AppendLine(");");
                sb.AppendLine();
            }

            var output = sb.ToString();
